import styled, { keyframes } from 'styled-components';

export const Home = styled.div`
  margin-top: 50px;
  position: absolute;
`;

export const moveUp = keyframes`
  0% {
    top: 200px;
  }

  100% {
    top: 50px;
  }
`;


export const BigText = styled.p`
  font-size: 38px;
  animation: ${moveUp} 5s;
`;
